import React from 'react'
import headerCSS from './../Header/Header.module.css';
import {Swiper, SwiperSlide} from 'swiper/react';
import {Autoplay , Parallax} from 'swiper/modules';
import 'swiper/css'
export default function Header() {
  return (
    <div className={headerCSS.header_wrapper}>

        <Swiper
            slidesPerView={1}
            spaceBetween={0}
            loop={true}
            autoplay={{
                delay: 2500,
            }}
            parallax={true}
            speed={1500}
            modules={[Autoplay , Parallax]}
            className={headerCSS.swiper}
         >
            <SwiperSlide>
                <div className={`${headerCSS.Header_slide}${headerCSS.slide1}`}>
                    <div className={`${headerCSS.content}`}>
                        <small data-swiper-parallax="-200">Luxury Hotel & Restaurant Website</small>
                        <h2 data-swiper-parallax="-400">Enjoy Your <span>Dream</span> Time with <br/>
                        <span>Luxury</span> Experience</h2>
                        <p data-swiper-parallax="-600">Call Now <span>7877899144</span></p>
                    </div>
                </div>
            </SwiperSlide>
            <SwiperSlide>
                <div className={`${headerCSS.Header_slide}${headerCSS.slide2}`}>
                    <div className={`${headerCSS.content}`}>
                        <small data-swiper-parallax="-200">Luxury Hotel & Restaurant Website</small>
                        <h2 data-swiper-parallax="-400">Enjoy Your <span>Dream</span> Time with <br/>
                        <span>Luxury</span> Experience</h2>
                        <p data-swiper-parallax="-600">Call Now <span>7877899144</span></p>
                    </div>
                </div>
            </SwiperSlide>
            <SwiperSlide>
                <div className={`${headerCSS.Header_slide}${headerCSS.slide3}`}>
                    <div className={`${headerCSS.content} `}>
                        <small data-swiper-parallax="-200">Luxury Hotel & Restaurant Website</small>
                        <h2 data-swiper-parallax="-400">Enjoy Your <span>Dream</span> Time with <br/>
                        <span>Luxury</span> Experience</h2>
                        <p data-swiper-parallax="-600">Call Now <span>7877899144</span></p>

                    </div>
                </div>
            </SwiperSlide>
        </Swiper>
    </div>
  )
}
